import React from "react";
import { Button } from "@nextui-org/react";
import kfupmlogo from "../assets/kfupmlogo.png";
import { FaCalendarPlus } from "react-icons/fa";
import { FaCalendarCheck } from "react-icons/fa6";

const SideBar = () => {
  return (
    <div className="bg-white z-0 min-w-72 max-w-72 relative">
      <aside className="h-full border-r border-gray-200 flex flex-col">
        <div className="p-4 h-24 sm:h-16 flex items-center justify-center space-x-2">
          <img src={kfupmlogo} className="w-9" alt="KFUPM Logo" />
          <div className="font-bold text-xl text-kfupmgreen">
            KFUPM <span className="text-textgray">Clinic</span>
          </div>
        </div>

        <div className="flex flex-col justify-between flex-1">
          <div className="space-y-8">
            <div className="space-y-2 p-2 pt-8">
              <div className="pl-6 pt-2 pr-4 space-y-8 max-w-fit">
                <Button
                  ripple={true}
                  className="flex items-center text-start font-normal text-base min-w-full max-w-full bg-transparent text-textgray relative p-2"
                >
                  <FaCalendarPlus className="mr-2" />
                  Schedule Appointment
                </Button>
                <Button
                  ripple={true}
                  className="text-start font-normal text-base min-w-full max-w-full bg-transparent text-textgray relative"
                >
                  Appointments
                </Button>
              </div>
            </div>
          </div>
        </div>
      </aside>
    </div>
  );
};

export default SideBar;
